import React from "react";
import Header from "../components/Header";
import "./Home.css";
import AnimalCard from "../components/AnimalCard";

const Home = () => {
  const animals = [
    {
      name: "Junior",
      gender: "On",
      age: "Młody",
      size: "Średni",
      img: "/i",
    },
    {
      name: "Tosia",
      gender: "Ona",
      age: "Senior",
      size: "Duża",
      img: "/img/tosia.jpg",
    },
    {
      name: "Heniek",
      gender: "On",
      age: "Dorosły",
      size: "Średni",
      img: "/img/heniek.jpg",
    },
    {
      name: "Bunia",
      gender: "Ona",
      age: "Młoda",
      size: "Mała",
      img: "/img/bunia.jpg",
    },
  ];

  return (
    <div>
      

      <section className="hero-section">
        <div className="hero-text">
          <h2>Adoptuj zwierzaka</h2>
          <p>Nasze pupile czekają na Ciebie</p>
          <div className="filters">
            <button>Pies</button>
            <button>Kot</button>
            <select>
              <option>Wielkość</option>
            </select>
            <select>
              <option>Wiek</option>
            </select>
            <select>
              <option>Płeć</option>
            </select>
            <button className="search-button">Szukaj</button>
          </div>
        </div>
        <img src="/dog-cat-hero.png" alt="dog and cat" className="hero-img" />
      </section>

      <section className="about-section">
        <h3>O NAS</h3>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed do eiusmod tempor incididunt...
        </p>
        <img src="/cat-dog-side.png" alt="cat and dog" className="about-img" />
      </section>

      <section className="adoption-section">
        <h3>Pupile do adopcji</h3>
        <div className="animal-list">
          {animals.map((a, i) => (
            <AnimalCard
              key={i}
              name={a.name}
              gender={a.gender}
              age={a.age}
              size={a.size}
              img={a.img}
            />
          ))}
        </div>
        <button className="more-button">ZOBACZ WIĘCEJ ZWIERZAKÓW</button>
      </section>
    </div>
  );
};

export default Home;
